(336, 'Bài 4: Những họa cụ cần thiết của khóa học', NULL, 0, 3, NULL, 12, NULL, '595694662', '0:06:57', NULL, 'https://anyclass.vn/storage/photos/124/Vẽ Arcrylic/Giáo trình - chuong1bai4- 550x300px-min.jpg', NULL, NULL, 0, NULL, NULL, NULL, 0, NULL, '2021-09-01 03:39:14', '2021-09-01 07:26:42', NULL),
(337, 'Giới thiệu khóa học', NULL, 0, 0, NULL, 107, '599938850', '600078923', '0:0:0', NULL, 'https://anyclass.vn/storage/photos/124/Phát triển bản thân/Kỹ năng, nghề nghiệp/Sale bảo hiểm - Thanh Mai/i diện khoa hoc.jpg', NULL, NULL, 0, NULL, '<p>Xin ch&agrave;o c&aacute;c bạn!</p>\r\n\r\n<p>Thanh Mai rất cảm ơn c&aacute;c bạn đ&atilde; tin tưởng v&agrave; đăng k&yacute; kho&aacute; học &quot;Đại l&yacute; tư vấn bảo hiểm nh&acirc;n thọ, b&iacute; k&iacute;p chốt đơn&quot;.</p>\r\n\r\n<p>Để ch&uacute;ng ta c&oacute; thể đạt được kết quả tốt, đầu ti&ecirc;n c&aacute;c bạn h&atilde;y xem kỹ từng b&agrave;i học nh&eacute;. Bạn h&atilde;y ghi ch&uacute; lại những th&ocirc;ng tin ch&iacute;nh v&agrave; ghi nhớ để vận dụng v&agrave;o từng trường hợp cụ thể trong thực tế.</p>\r\n\r\n<p>Khi bạn c&oacute; kh&oacute; khăn g&igrave; v&agrave; cần hỗ trợ, h&atilde;y lu&ocirc;n nhớ Thanh Mai lu&ocirc;n ở b&ecirc;n bạn.</p>\r\n\r\n<p>H&atilde;y tham gia nh&oacute;m lớp học, c&ugrave;ng Mai v&agrave; c&aacute;c học vi&ecirc;n kh&aacute;c trao đổi kinh nghiệm để mỗi người ch&uacute;ng ta đều chốt được ng&agrave;y c&agrave;ng nhiều hợp đồng. Bạn nh&eacute;.</p>\r\n\r\n<p>Th&acirc;n mến,</p>\r\n\r\n<p>Chuy&ecirc;n gia tư vấn bảo hiểm nh&acirc;n thọ Thanh Mai</p>', NULL, 1, NULL, '2021-09-08 02:20:04', '2021-09-30 08:44:21', NULL),
