(22, 'Trang kinh nghiệm', NULL, NULL, 'a:3:{s:10:\"kinhnghiem\";a:1:{s:4:\"name\";s:13:\"KINH NGHIỆM\";}s:11:\"content_exp\";a:1:{s:4:\"text\";s:1801:\"<p>Ho&agrave;ng Anh Composite&nbsp;l&agrave;&nbsp;<a href=\"http://www.composite.com.vn/\"><strong>c&ocirc;ng ty composite</strong></a>&nbsp;h&agrave;ng đầu với đội ngũ kỹ thuật nhiều năm kinh nghiệm trong chế tạo c&aacute;c&nbsp;<a href=\"http://www.composite.com.vn/vi/san-pham-composite-frp-theo-yeu-cau\"><strong>sản phẩm composite</strong></a>&nbsp;FRP:&nbsp;<strong><a href=\"http://www.composite.com.vn/vi/bon-composite\">bồn composite</a></strong>&nbsp;(FRP) chứa h&oacute;a chất, bồn chứa nước, bồn chứa thực phẩm, bồn xử l&yacute; nước thải, ống composite FRP, khung quạt hệ thống th&ocirc;ng gi&oacute;, khung quạt th&aacute;p giải nhiệt, mặt b&iacute;ch, b&agrave;n ghế composite,&nbsp;<strong><a href=\"http://www.composite.com.vn/vi/boc-phu-composite-frp\">bọc phủ composite</a></strong>&nbsp;(FRP) chống ăn m&ograve;n, chống thấm theo thiết kế cho c&aacute;c kh&aacute;ch h&agrave;ng:</p>\r\n\r\n<ul>\r\n	<li>Nh&agrave; m&aacute;y h&oacute;a chất Bi&ecirc;n H&ograve;a / Lilama 45.1</li>\r\n	<li>Unilever Việt Nam</li>\r\n	<li>Mercedes-Benz Việt Nam</li>\r\n	<li>Tập đo&agrave;n CP / KSP Việt Nam</li>\r\n	<li>Perfetti Van Melle Việt Nam</li>\r\n	<li>T&acirc;n Hiệp Ph&aacute;t</li>\r\n	<li>Pepsi</li>\r\n	<li>C&ocirc;ng ty x&acirc;y dựng Dong Myung</li>\r\n	<li>Viglacera Đ&ocirc;ng Triều</li>\r\n	<li>Cơ Điện Lạnh VMEC</li>\r\n	<li>Trung Nguy&ecirc;n Coffee</li>\r\n	<li>Vinamilk</li>\r\n	<li>Tobacco S.A.S</li>\r\n	<li>C&ocirc;ng ty kỹ nghệ v&agrave; x&acirc;y dựng Ho&agrave;ng Trung Ph&uacute; (HTP E&amp;C)</li>\r\n	<li>OKATSUNE</li>\r\n	<li>DKSH</li>\r\n	<li>KUBOTA</li>\r\n	<li>C&ocirc;ng ty thiết kế &amp; x&acirc;y dựng Thanh An</li>\r\n	<li>C&ocirc;ng ty cơ kh&iacute; Ph&uacute; Lợi</li>\r\n</ul>\";}s:9:\"duthuyeen\";a:2:{s:4:\"name\";s:11:\"Du thuyền\";s:11:\"description\";s:94:\"Một trong những thương hiệu sản xuất du thuyền cá nhân hàng đầu Việt Nam\";}}', 'active', NULL, NULL, NULL, NULL, NULL, NULL, 'a:3:{s:10:\"kinhnghiem\";a:1:{s:4:\"name\";s:3:\"eee\";}s:11:\"content_exp\";a:1:{s:4:\"text\";N;}s:9:\"duthuyeen\";a:2:{s:4:\"name\";s:9:\"experient\";s:11:\"description\";s:65:\"One of the leading personal yacht manufacturing brands in Vietnam\";}}', '0', '0', '0', NULL, '2021-08-18 17:00:00', '2022-07-01 07:47:03', NULL),
