(27, 'Trang tuyển dụng', NULL, NULL, 'a:3:{s:9:\"tuyendung\";a:2:{s:4:\"name\";s:14:\"Tuyền dụng\";s:4:\"text\";s:5043:\"<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">Do nhu cầu mở rộng sản xuất, c&ocirc;ng ty Ho&agrave;ng Anh Composite tuyển dụng c&aacute;c vị tr&iacute; sau:</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\"><strong>1. Chuy&ecirc;n vi&ecirc;n ph&ograve;ng kỹ thuật (Số lượng: 02 người )</strong></span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">Y&ecirc;u cầu :</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Nam \\ Nữ</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Tuổi dưới 45</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Tốt nghiệp Đại Học \\ Cao Đẳng (c&aacute;c ng&agrave;nh cơ kh&iacute;, x&acirc;y dựng c&ocirc;ng nghiệp, vật liệu Polymer )</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Đọc hiểu bản vẽ , vẽ kỹ thuật, th&agrave;nh thạo Auto CAD 2D ( bắt buộc )</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Ngoại ngữ : Tiếng Anh (giao tiếp tiếng Anh đơn gi&atilde;n, đọc hiểu văn bản) ; biết tiếng Nhật được đặc biệt ưu ti&ecirc;n tuyển dụng</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Kinh nghiệm (c&oacute; kinh nghiệm được ưu ti&ecirc;n)</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">C&ocirc;ng việc : L&agrave;m việc tại Bp. Kỹ thuật như thiết kế sản phẩm, triễn khai sản xuất v&agrave; kiểm so&aacute;t chất lượng sản phẩm</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\"><strong>2. C&ocirc;ng nh&acirc;n kỹ thuật (Số lượng : 04) &ndash; Đ&agrave;o tạo để trở th&agrave;nh c&aacute;c tổ trưởng</strong></span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Nam</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Tuổi : dưới 38</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Tốt nghiệp Trung cấp chuy&ecirc;n nghiệp ( c&aacute;c ng&agrave;nh cơ kh&iacute; hoặc c&aacute;c ng&agrave;nh kỹ thuật kh&aacute;c )</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Đọc hiểu bản vẽ kỹ thuật ( bắt buộc )</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Ngoại ngữ : Biết tiếng Anh / tiếng Nhật ( được ưu ti&ecirc;n, đặc biệt ưu ti&ecirc;n tu nghiệp sinh ở Nhật về )</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Kinh nghiệm ( c&oacute; kinh nghiệm được ưu ti&ecirc;n )</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\"><strong>3. Thủ kho / kế to&aacute;n kho</strong></span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Nam / Nữ</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Tuổi dưới 35</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Tốt nghiệp c&aacute;c ng&agrave;nh c&oacute; li&ecirc;n quan</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Ngoại ngữ : ưu ti&ecirc;n cho những người biết tiếng Anh / Nhật</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\"><strong>4. C&ocirc;ng Nh&acirc;n sản xuất</strong></span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Nam / Nữ</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Tuổi: trong độ tuổi lao động</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Tr&igrave;nh độ : biết đọc, viết tiếng Việt (ưu ti&ecirc;n biết ngoại ngữ)</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">Ng&agrave;nh nghề: chế tạo sản phẩm bằng vật liệu nhựa composite: bồn chứa nước, bồn chứa thực phẩm, bồn chứa h&oacute;a chất, bồn chứa axit, ống dẫn bằng vật liệu composite (FRP)</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\"><strong>Nơi l&agrave;m việc : An Tịnh, Trảng B&agrave;ng, T&acirc;y Ninh (gần KCN Trảng B&agrave;ng)</strong></span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">Th&ocirc;ng tin li&ecirc;n hệ:</span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- Email:&nbsp;<a href=\"mailto:info@composite.com.vn\">info@composite.com.vn</a></span></span></p>\r\n\r\n<p><span style=\"line-height:2;\"><span style=\"font-size:16px;\">- SĐT: +84 663 899 899</span></span></p>\";}s:13:\"services_page\";a:2:{s:4:\"name\";s:29:\"Dịch vụ của chúng tôi\";s:11:\"description\";s:55:\"Trải nghiệm đẳng cấp, giá trị xứng tầm!\";}s:4:\"lvhd\";a:1:{s:4:\"name\";s:26:\"Lĩnh vực hoạt động\";}}', 'active', NULL, NULL, NULL, NULL, NULL, NULL, 'a:3:{s:9:\"tuyendung\";a:2:{s:4:\"name\";s:6:\"sadasd\";s:4:\"text\";s:2347:\"<p>Do nhu cầu mở rộng sản xuất, c&ocirc;ng ty Ho&agrave;ng Anh Composite tuyển dụng c&aacute;c vị tr&iacute; sau: 1. Chuy&ecirc;n vi&ecirc;n ph&ograve;ng kỹ thuật (Số lượng: 02 người ) Y&ecirc;u cầu : - Nam \\ Nữ - Tuổi dưới 45 - Tốt nghiệp Đại Học \\ Cao Đẳng (c&aacute;c ng&agrave;nh cơ kh&iacute;, x&acirc;y dựng c&ocirc;ng nghiệp, vật liệu Polymer ) - Đọc hiểu bản vẽ , vẽ kỹ thuật, th&agrave;nh thạo Auto CAD 2D ( bắt buộc ) - Ngoại ngữ : Tiếng Anh (giao tiếp tiếng Anh đơn gi&atilde;n, đọc hiểu văn bản) ; biết tiếng Nhật được đặc biệt ưu ti&ecirc;n tuyển dụng - Kinh nghiệm (c&oacute; kinh nghiệm được ưu ti&ecirc;n) C&ocirc;ng việc : L&agrave;m việc tại Bp. Kỹ thuật như thiết kế sản phẩm, triễn khai sản xuất v&agrave; kiểm so&aacute;t chất lượng sản phẩm 2. C&ocirc;ng nh&acirc;n kỹ thuật (Số lượng : 04) &ndash; Đ&agrave;o tạo để trở th&agrave;nh c&aacute;c tổ trưởng - Nam - Tuổi : dưới 38 - Tốt nghiệp Trung cấp chuy&ecirc;n nghiệp ( c&aacute;c ng&agrave;nh cơ kh&iacute; hoặc c&aacute;c ng&agrave;nh kỹ thuật kh&aacute;c ) - Đọc hiểu bản vẽ kỹ thuật ( bắt buộc ) - Ngoại ngữ : Biết tiếng Anh / tiếng Nhật ( được ưu ti&ecirc;n, đặc biệt ưu ti&ecirc;n tu nghiệp sinh ở Nhật về ) - Kinh nghiệm ( c&oacute; kinh nghiệm được ưu ti&ecirc;n ) 3. Thủ kho / kế to&aacute;n kho - Nam / Nữ - Tuổi dưới 35 - Tốt nghiệp c&aacute;c ng&agrave;nh c&oacute; li&ecirc;n quan - Ngoại ngữ : ưu ti&ecirc;n cho những người biết tiếng Anh / Nhật 4. C&ocirc;ng Nh&acirc;n sản xuất - Nam / Nữ - Tuổi: trong độ tuổi lao động - Tr&igrave;nh độ : biết đọc, viết tiếng Việt (ưu ti&ecirc;n biết ngoại ngữ) Ng&agrave;nh nghề: chế tạo sản phẩm bằng vật liệu nhựa composite: bồn chứa nước, bồn chứa thực phẩm, bồn chứa h&oacute;a chất, bồn chứa axit, ống dẫn bằng vật liệu composite (FRP) Nơi l&agrave;m việc : An Tịnh, Trảng B&agrave;ng, T&acirc;y Ninh (gần KCN Trảng B&agrave;ng) Th&ocirc;ng tin li&ecirc;n hệ: - Email: info@composite.com.vn - SĐT: +84 663 899 899</p>\";}s:13:\"services_page\";a:2:{s:4:\"name\";s:7:\"Service\";s:11:\"description\";s:31:\"Classy experience, worthy value\";}s:4:\"lvhd\";a:1:{s:4:\"name\";s:5:\"Lvhđ\";}}', '0', '0', '0', NULL, '2021-08-18 17:00:00', '2022-08-02 16:00:54', NULL),
