(110, 'Bàn ăn gấp gọn thông minh (4 ghế)', '1250000', '1000000', '<p><span style=\"font-family:Arial,Helvetica,sans-serif;\"><em>B&agrave;n Ăn Th&ocirc;ng Minh L&agrave; d&ograve;ng&nbsp;<strong><a href=\"https://noithatdailoi.com/danh-muc/ban-ghe-an/bo-ban-an/\">b&agrave;n ăn</a></strong>&nbsp;c&oacute; thiết kế đặc biệt với nhiều chức năng kh&aacute;c nhau như: Gấp gọn, dễ d&agrave;ng th&aacute;o lắp, tăng giảm k&iacute;ch thước. Hay sự thay đổi kiểu d&aacute;ng chức năng để ph&ugrave; hợp với người sử dụng. Ng&agrave;y nay những d&ograve;ng b&agrave;n n&agrave;y ng&agrave;y c&agrave;ng được ưa chuộng do t&iacute;nh hữu dụng của n&oacute; mang lại.</em></span></p>', NULL, '<p><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>Thiết kế th&ocirc;ng minh, tinh tế v&agrave; tiện dụng</strong></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">+ B&agrave;n được thiết kế th&ocirc;ng minh với k&iacute;ch cỡ vừa phải c&oacute; thể thu gọn sau khi sử dụng v&agrave; c&oacute; thể đặt khắp nơi trong nh&agrave;, đặc biệt l&agrave; những kh&ocirc;ng gian nh&agrave; cần tiết kiệm diện t&iacute;ch. Thiết kế B&agrave;n tinh tế giống như vật dụng trang tr&iacute; trong nh&agrave; với m&agrave;u sắc nổi bật sẽ gi&uacute;p mọi người cảm thấy vui vẻ v&agrave; thoải m&aacute;i hơn.</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">+ Tất cả c&aacute;c g&oacute;c cạnh của b&agrave;n ghế đều được bo tr&ograve;n để an to&agrave;n cho người sử dụng. Sản phẩm được trau chuốt về g&oacute;c cạnh &ndash; gi&uacute;p an to&agrave;n cho trẻ nhỏ, thiết kế b&agrave;n ghế đặc biệt ph&ugrave; hợp cả về chiều cao v&agrave; độ tiện dụng gi&uacute;p bạn v&agrave; gia đ&igrave;nh lu&ocirc;n thấy thoải m&aacute;i, cả khi ngồi l&acirc;u.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" height=\"750\" src=\"https://salt.tikicdn.com/ts/tmp/b4/42/e6/b8ac99b4b1f0566f50e88bce8251338d.png\" srcset=\"https://salt.tikicdn.com/cache/w750/ts/tmp/b4/42/e6/b8ac99b4b1f0566f50e88bce8251338d.png 1x, https://salt.tikicdn.com/cache/w750/ts/tmp/b4/42/e6/b8ac99b4b1f0566f50e88bce8251338d.png 2x\" width=\"750\" /></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">+ B&ecirc;n dưới mặt b&agrave;n l&agrave; 2 ngăn đựng đồ được thiết kế tiện lợi để đựng th&ecirc;m những vật dụng cần thiết khi sử dụng.</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">+ B&agrave;n&nbsp;thiết kế ph&ugrave; hợp với nhiều phong c&aacute;ch nội thất. Kiểu d&aacute;ng sang trọng, đẹp mắt, bộ b&agrave;n n&agrave;y th&iacute;ch hợp để tiếp kh&aacute;ch, l&agrave;m b&agrave;n tr&agrave;, b&agrave;n ă trong văn ph&ograve;ng, gia đ&igrave;nh hoặc qu&aacute;n cafe. Thiết kế trang nh&atilde;, hiện đại v&agrave; cũng đầy cảm hứng, sẽ g&oacute;p phần t&ocirc; điểm cho kh&ocirc;ng gian sống th&ecirc;m sang trọng, hiện đại.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" height=\"750\" src=\"https://salt.tikicdn.com/ts/tmp/4a/f0/53/67c193ec862e313e2a7843f3c5e77f99.png\" srcset=\"https://salt.tikicdn.com/cache/w750/ts/tmp/4a/f0/53/67c193ec862e313e2a7843f3c5e77f99.png 1x, https://salt.tikicdn.com/cache/w750/ts/tmp/4a/f0/53/67c193ec862e313e2a7843f3c5e77f99.png 2x\" width=\"750\" /></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>Chất liệu th&acirc;n thiện với m&ocirc;i trường.</strong></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">+ B&agrave;n được l&agrave;m tử chất liệu gỗ MFC nhập khẩu Malaysia, bề Mặt b&agrave;n Melamine chống thấm s&aacute;ng b&oacute;ng gi&uacute;p cho b&agrave;n chống nước v&agrave; chống xước một c&aacute;ch hiệu quả. Ch&acirc;n b&agrave;n được phủ sơn 3 lớp cao cấp, ti&ecirc;u chuẩn E0.</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">+ Sản phẩm kh&ocirc;ng chỉ đẹp hơn về mỹ quan m&agrave; c&ograve;n mang lại độ bền chắc l&acirc;u d&agrave;i. Đ&atilde; qua xử l&yacute; chống cong v&ecirc;nh, mối mọt bằng c&ocirc;ng nghệ của Đức, Sản phẩm th&acirc;n thiện v&agrave; an to&agrave;n cho sức khỏe gia đ&igrave;nh v&agrave; m&ocirc;i trường.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" height=\"750\" src=\"https://salt.tikicdn.com/ts/tmp/b9/d7/61/085b6f5ddf6d1eb1bb0e4ac9f9c19032.png\" srcset=\"https://salt.tikicdn.com/cache/w750/ts/tmp/b9/d7/61/085b6f5ddf6d1eb1bb0e4ac9f9c19032.png 1x, https://salt.tikicdn.com/cache/w750/ts/tmp/b9/d7/61/085b6f5ddf6d1eb1bb0e4ac9f9c19032.png 2x\" width=\"750\" /></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>Kết cấu chắc chắn, an to&agrave;n</strong></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">+ Kết cấu B&agrave;n theo module sản xuất h&agrave;ng loạt bằng robot hiện đại. Tất cả những phụ kiện bản lề, ray trượt giảm chấn nhập khẩu từ ch&acirc;u &Acirc;u, đảm bảo an to&agrave;n v&agrave; chất lượng. B&agrave;n được thiết kế an to&agrave;n về kỹ thuật, c&oacute; thể chịu được trọng lượng lớn n&ecirc;n gia đ&igrave;nh c&oacute; thểm y&ecirc;n t&acirc;m khi sử dụng.</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">+ Ch&acirc;n b&agrave;n cứng chắc, chịu lực tốt, chịu được c&aacute;c va đập n&ecirc;n kh&ocirc;ng bị biến dạng, cong v&ecirc;nh trong qu&aacute; tr&igrave;nh sử dụng. Khả năng c&acirc;n bằng tốt, gi&uacute;p B&agrave;n đứng vững tr&ecirc;n mặt s&agrave;n, kh&ocirc;ng bị rung lắc, ch&ocirc;ng ch&ecirc;nh khi ngồi.</span></p>', 'bRs0p4pTAg.mp4', 1, NULL, 'https://thongminhmart.com/storage/photos/1/Thumbnail_BanAnGapGon.jpg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'ban-an-gap-gon-thong-minh-4-ghe', NULL, 4, NULL, NULL, NULL, 1, '2022-07-06 12:07:39', '2022-07-28 08:38:17', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:9:{s:10:\"tie