(111, 'Chậu silicon gấp gọn thông minh', '85000', '60000', '<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">Thau chậu nhựa gấp gọn tiện dụng, tiết kiệm kh&ocirc;ng gian, mang theo du lịch, đồ gia dụng th&ocirc;ng minh cao cấp</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- Thau chậu gấp gọn tiện lợi, nhỏ gọn, dễ d&agrave;ng để bạn mang theo khắp mọi nơi</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- Chất liệu silicon si&ecirc;u bền, sang trọng</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- L&agrave;m chậu rửa mặt, rửa ch&acirc;n, rửa ch&eacute;n b&aacute;t, giặt đồ, tắm cho b&eacute;...</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- M&agrave;u như xanh, hồng đất, t&iacute;m nhạt (mẫu ngẫu nhi&ecirc;n)</span></span></span></p>', NULL, '<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- Chậu nhựa gấp gọn gi&uacute;p bạn tiết kiệm tối đa diện t&iacute;ch m&agrave; tr&ocirc;ng vẫn rất đẹp mắt v&agrave; hiện đại</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- Thiết kế lỗ treo tiện &iacute;ch, gi&uacute;p mau kh&ocirc; r&aacute;o</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- Th&iacute;ch hợp đi du lịch xa c&ugrave;ng gia đ&igrave;nh người th&acirc;n, d&ugrave;ng chậu để l&agrave;m chậu rửa mặt, chậu rửa b&aacute;t rất tiện lợi</span></span></span></p>', 'JRSx7TtxZJ.mp4', 1, NULL, 'https://thongminhmart.com/storage/photos/1/Thumbnail_ChauGapGon.jpeg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'chau-silicon-gap-gon-thong-minh', NULL, 3, NULL, NULL, NULL, 1, '2022-07-06 12:07:39', '2022-07-28 08:38:44', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:9:{s:10:\"tieu_chi_1\";a:2:{s:4:\"name\";s:13:\"Chất liệu\";s:11:\"description\";s:23:\"Silicon & nhựa cứng\";}s:10:\"tieu_chi_2\";a:2:{s:4:\"name\";s:10:\"Màu sắc\";s:11:\"description\";s:19:\"Xám, hồng đất\";}s:10:\"tieu_chi_3\";a:2:{s:4:\"name\";s:15:\"Khối lượng\";s:11:\"description\";s:5:\"0,5kg\";}s:10:\"tieu_chi_4\";a:2:{s:4:\"name\";s:11:\"Xuất xứ\";s:11:\"description\";s:12:\"Trung Quốc\";}s:10:\"tieu_chi_5\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_6\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_7\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_8\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_9\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}}', 'a:9:{s:11:\"meta_size_1\";a:4:{s:4:\"name\";s:13:\"35cm x 10.5cm\";s:6:\"status\";s:6:\"active\";s:10:\"price_base\";s:5:\"70000\";s:11:\"price_final\";s:5:\"50000\";}s:11:\"meta_size_2\";a:4:{s:4:\"name\";s:13:\"45cm x 10.5cm\";s:6:\"status\";s:6:\"active\";s:10:\"price_base\";s:5:\"90000\";s:11:\"price_final\";s:5:\"65000\";}s:11:\"meta_size_3\";a:4:{s:4:\"name\";s:11:\"32cm x 12cm\";s:6:\"status\";s:6:\"active\";s:10:\"price_base\";s:5:\"75000\";s:11:\"price_final\";s:5:\"55000\";}s: