(112, 'Thùng rác thông minh', '250000', '190000', '<p><span style=\"font-size:16px;\"><span style=\"line-height:1;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Th&ugrave;ng r&aacute;c treo tủ bếp bằng nhựa c&oacute; nắp đậy dạng trượt th&ocirc;ng minh, đựng r&aacute;c si&ecirc;u tiện lợi cho kh&ocirc;ng gian nh&agrave; bếp.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"line-height:1;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Th&ugrave;ng r&aacute;c treo tủ bếp Royal l&agrave; một sản phẩm đột ph&aacute; của h&atilde;ng, th&ugrave;ng r&aacute;c c&oacute; thể được treo gọn g&agrave;ng trước cửa tủ bếp bằng thanh ray, rất thuận tiện cho việc di chuyển nhiều vị tr&iacute;.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"line-height:1;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Nắp mở th&ocirc;ng minh dạng trượt, gạt r&aacute;c từ s&agrave;n bếp tiện dụng.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"line-height:1;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Đ&acirc;y sẽ l&agrave; sản phẩm được mong đợi nhất 2022 cho tiện nghi ph&ograve;ng bếp hiện đại. </span></span></span></p>', NULL, '<p align=\"left\" style=\"text-align:left; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Thiết kế th&ugrave;ng đựng r&aacute;c th&ocirc;ng minh: treo được tr&ecirc;n c&aacute;nh tủ kệ bếp v&agrave; kh&ocirc;ng ảnh hưởng tới việc đ&oacute;ng mở cửa tủ.&nbsp;</span></span></span></p>\r\n\r\n<p align=\"left\" style=\"text-align:left; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">* Nắp đậy dạng trượt th&ocirc;ng minh, chỉ cần trượt sang tr&aacute;i để mở rồi ấn nhẹ xuống l&agrave; sẽ giữ được nắp mở sau khi gạt r&aacute;c v&agrave;o th&igrave; lại ấn nhẹ 1 lần nữa l&agrave; nắp th&ugrave;ng sẽ đ&oacute;ng lại do c&oacute; l&ograve; xo rất nhạy. </span></span></span></p>\r\n\r\n<p align=\"left\" style=\"text-align:left; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">* Vứt r&aacute;c kh&ocirc;ng cần khom lưng, c&aacute;c chất bẩn kh&ocirc;ng rớt l&ecirc;nh l&aacute;ng khắp nơi, khi qu&eacute;t lau s&agrave;n nh&agrave; kh&ocirc;ng bị vướng v&iacute;u</span></span></span></p>\r\n\r\n<p align=\"left\" style=\"text-align:left; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">* Thiết kế th&ugrave;ng đựng r&aacute;c c&oacute; nắp đậy dạng trượt gi&uacute;p đ&oacute;ng mở dễ d&agrave;ng, kh&ocirc;ng c&oacute; m&ugrave;i h&ocirc;i v&agrave; c&ocirc;n tr&ugrave;ng bay v&agrave;o th&ugrave;ng r&aacute;c gi&uacute;p ph&ograve;ng bếp lu&ocirc;n sạch sẽ. Ngo&agrave;i phục vụ cho kh&ocirc;ng gian bếp th&igrave; th&ugrave;ng r&aacute;c c&oacute; nắp đậy c&ograve;n ph&ugrave; hợp nhiều vị tr&iacute; kh&aacute;c như: th&ugrave;ng r&aacute;c văn ph&ograve;ng, trong nh&agrave; vệ sinh,... </span></span></span></p>\r\n\r\n<p align=\"left\" style=\"text-align:left; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">* Đa phần th&ugrave;ng r&aacute;c treo tủ bếp được c&aacute;c b&agrave; nội trợ rất hay sử dụng do t&iacute;nh tiện lợi n&ecirc;n c&ograve;n c&oacute; t&ecirc;n gọi kh&aacute;c l&agrave; th&ugrave;ng r&aacute;c nh&agrave; bếp * Th&aacute;o lắp đơn giản ngay cả từ việc th&aacute;o/lắp t&uacute;i đựng r&aacute;c, th&aacute;o/lắp th&ugrave;ng r&aacute;c l&ecirc;n tủ.</span></span></span></p>\r\n\r\n<p align=\"left\" style=\"text-align:left; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">* Th&ugrave;ng r&aacute;c th&ocirc;ng minh nhỏ gọn dễ d&agrave;ng vệ sinh </span></span></span></p>', 'WJ6Pk6x0vh.mp4', 1, NULL, 'https://thongminhmart.com/storage/photos/1/Thumbnail_ThungRac.jpg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'thung-rac-thong-minh', NULL, 3, NULL, NULL, NULL, 1, '2022-07-06 12:07:39', '2022-07-28 08:39:24', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:9:{s:10:\"tieu_chi_1\";a:2:{s:4:\"name\";s:14:\"Kích thước\";s:11:\"description\";s:18:\"28cm x 27cm x 17cm\";}s:10:\"tieu_chi_2\";a:2:{s:4:\"name\";s:13:\"Chất liệu\";s:11:\"description\";s:27:\"Nhựa PP nguyên sinh 100%\";}s:10:\"tieu_chi_3\";a:2:{s:4:\"name\";s:10:\"Màu sắc\";s:11:\"description\";s:21:\"Nâu cafe - Ghi sáng\";}s:10:\"tieu_chi_4\";a:2:{s:4:\"name\";s:16:\"Trọng lượng\";s:11:\"description\";s:5:\"0.8kg\";}s:10:\"tieu_chi_5\";a:2:{s:4:\"name\";s:11:\"Xuất xứ\";s:11:\"description\";s:12:\"Trung Quốc\";}s:10:\"tieu_chi_6\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_7\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_8\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_9\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}}', 'a:9:{s:11:\"meta_size_1\";a:4:{s:4:\"name\";s:18:\"28cm x 27cm x 17cm\";s:6:\"status\";s:6:\"active\";s:10:\"price_base\";s:6:\"300000\";s:11:\"price_final\";s:6:\"230000\";}s:11:\"meta_size_2\";a:4:{s:4:\"name\";s:18:\"22cm x 18cm x 12cm\";s:6:\"status\";s:6:\"active\";s:10:\"price_base\";s:6:\"150000\";s:11:\"price_final\";s:6:\"110000\";}s:11:\"meta_size_3\";a:4:{s:4:\"name\";N;s:6:\"status\";s:8:\"inactive\";s:10:\"price_base\";N;s:11:\"price_final\";N;}s:11:\"meta_size_4\";a:4:{s:4:\"name\";N;s:6:\"status\";s:8:\"inactive\";s:10:\"price_base\";N;s:11:\"price_final\";N;}s:11:\"meta_size_5\";a:4:{s:4:\"name\";N;s:6:\"status\";s:8:\"inactive\";s:10:\"price_base\";N;s:11:\"price_final\";N;}s:11:\"meta_size_6\";a:4:{s:4:\"name\";N;s:6:\"status\";s:8:\"inactive\";s:10:\"price_base\";N;