(113, 'Nắp rửa điện tử washlet', '550000', '420000', '<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">Sản phẩm th&ocirc;ng minh: Thiết bị v&ograve;i rửa vệ sinh th&ocirc;ng minh LUVA BIDET sẽ thay thế ho&agrave;n to&agrave;n giấy vệ sinh truyền thống, mang đến phong c&aacute;ch sống hiện đại cho gia đ&igrave;nh bạn.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">Made in Việt Nam: LUVA tự h&agrave;o l&agrave; sản phẩm sản xuất v&agrave; lắp r&aacute;p tại Việt Nam theo c&ocirc;ng nghệ ti&ecirc;u chuẩn H&agrave;n Quốc. Tất cả linh kiện, phụ kiện đều được nhập khẩu ch&acirc;u &Acirc;u v&agrave; H&agrave;n Quốc, c&oacute; đầy đủ CO, CQ.</span></span></span></p>', NULL, '<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">- Lắp đặt đơn giản (Tự m&igrave;nh c&oacute; thể lắp đặt)</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">- Đặc biệt thiết bị kh&ocirc;ng sử dụng điện, an to&agrave;n tuyệt đối</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">- Dễ d&agrave;ng vệ sinh cặn bẩn</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">- Tiện lợi vệ sinh, rửa v&ograve;i phun</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">- Lắp đặt v&agrave;o bồn cầu c&oacute; sẵn, kh&ocirc;ng phải thay thế bồn cầu mới</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">- Sử dụng &ecirc;m &aacute;i, thoải m&aacute;i, dễ d&agrave;ng kiểm so&aacute;t &aacute;p lực nước</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Bảo vệ phần nhạy cảm</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Giấy vệ sinh kh&ocirc;ng hề sạch, sử dụng v&ograve;i rửa vệ sinh sẽ gi&uacute;p l&agrave;m sạch những phần nhạy cảm nhất.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Tiết kiệm tiền bạc</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Hạn chế bệnh trĩ</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Sử dụng giấy vệ sinh bẩn v&agrave; r&aacute;p l&agrave; 1 nguy&ecirc;n nh&acirc;n g&acirc;y ra bệnh trĩ. V&igrave; vậy với những người bị bệnh trĩ, b&aacute;c sĩ sẽ chỉ định phải rửa vệ sinh bằng nước. Bạn may mắn v&igrave; đ&atilde; biết những th&ocirc;ng tin n&agrave;y sớm, h&atilde;y ngăn chặn chứng bệnh nguy hiểm n&agrave;y ngay khi c&oacute; thể cho bản th&acirc;n v&agrave; gia đ&igrave;nh. Chỉ đơn giản bằng việc d&ugrave;ng bidet thay giấy vệ sinh.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Rất tốt cho trẻ em</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Với sản phẩm bidet, bạn sẽ kh&ocirc;ng cần lau ch&ugrave;i cho trẻ sau khi đi vệ sinh. Chỉ cần hướng dẫn cho trẻ ngồi đ&uacute;ng vị tr&iacute; v&agrave; nhấn n&uacute;t. Đ&acirc;y l&agrave; c&aacute;ch gi&aacute;o dục vệ sinh c&aacute; nh&acirc;n cho trẻ rất dễ d&agrave;ng.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Kh&ocirc;ng tắc bồn cầu</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Bạn sẽ kh&ocirc;ng cần phải lo lắng việc th&ocirc;ng tắc bể phốt, hay h&uacute;t bồn cầu nữa. Việc giảm giấy vệ sinh sẽ gi&uacute;p bể chứa c&oacute; nhiều kh&ocirc;ng gian hơn, sử dụng được trong thời gian d&agrave;i hơn gấp đ&ocirc;i th&ocirc;ng thường.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Lưu &yacute;:</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Thiết bị lắp vừa khoảng 99% c&aacute;c loại bồn cầu tr&ecirc;n thị trường, trừ 1 số bồn cầu dạng đặc biệt, để chắc chắn th&igrave; Kh&aacute;ch h&agrave;ng chat inbox, gửi ảnh bồn cầu của Kh&aacute;ch cho shop để tư vấn cho chuẩn nhất nh&eacute;, nếu kh&ocirc;ng chat hỏi trước, mua về kh&ocirc;ng vừa shop kh&ocirc;ng hỗ trợ đổi trả lại ạ.</span></span></span></p>', 'jTUQU6K2Tt.mp4', 2, NULL, 'https://thongminhmart.com/storage/photos/1/Thumbnail_Voixit.jpg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'nap-rua-dien-tu-washlet', NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-13 07:46:08', '2022-08-02 17:30:29', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:9:{s:10:\"tieu_chi_1\";a:2:{s:4:\"name\";s:14:\"Kích thước\";s:11:\"description\";s:34:\"Dài 44cm x Rộng 19cm x Cao 10cm\";}s:10:\"tieu_chi_2\";a:2:{s:4:\"name\";s:10:\"Màu sắc\";s:11:\"description\";s:7:\"Trắng\";}s:10:\"tieu_chi_3\";a:2:{s:4:\"name\";s:12:\"Vật liệu\";s:11:\"description\";s:9:\"Composite\";}s:10:\"tieu_chi_4\";a:2:{s:4:\"name\";s:14:\"Số vòi phun\";s:11:\"description\";s:2:\"01\";}s:10:\"tieu_chi_5\";a:2:{s:4:\"name\";s:15:\"Thương hiệu\";s:11:\"description\";s:4:\"LUVA\";}s:10:\"tieu_chi_6\";a:2:{s:4:\"name\";s:11:\"Xuất xứ\";s:11:\"description\";s:10:\"Việt Nam\";}s:10:\"tieu_chi_7\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_8\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_9\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}}', 'a:9:{s:11:\"meta_size_1\";a:4:{s:4:\"name\";s:18:\"44cm x 19cm x 10cm\";s:6:\"status\";s:6:\"active\";s:10:\"price_base\";s:6:\"550000\";s:11:\"price_final\";s:6:\"420000\";}s:11:\"meta_size_2\";a:4:{s:4:\"name\";N;s:6:\"status\";s:8:\"inactive\";s:10:\"price_base\";N;s:11:\"price_final\";N;}s:11:\"meta_size_3\";a:4:{s:4:\"name\";N;s:6:\"status\";s:8:\"inactive\";s:10:\"price_base\";N;s:1