(119, 'Cây lau nhà thông minh tự vắt - xoay 360 độ', '110000', '100000', '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">C&acirc;y lau nh&agrave; th&ocirc;ng minh tự vắt</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Xoay 360 độ</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Dễ d&agrave;ng vệ sinh</span></p>', NULL, '<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">✅ T&Iacute;NH NĂNG</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">- Sản phẩm thiết kế th&ocirc;ng minh, dễ d&agrave;ng sử dụng, TỰ ĐỘNG T&Aacute;CH NƯỚC LAU BẨN V&Agrave; NƯỚC SẠCH</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">- K&iacute;ch thước nhỏ gọn rất ph&ugrave; hợp với tất cả c&aacute;c kh&ocirc;ng gian</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">- Chổi được thiết kế Bơm nước độc đ&aacute;o khi xoay (khi xoay bơm nước hoạt động v&agrave; bơm lượng nước vừa đủ để giặt b&ocirc;ng lau,v&agrave; tự động vắt kh&ocirc;)</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">- Cơ chế lau 360 độ xoay tr&ograve;n thuận tiện lau tới mọi ng&oacute;c ng&aacute;ch trong nh&agrave;</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">- Giặt chổi lau nh&agrave; chỉ cần một tay đưa l&ecirc;n v&agrave; xuống</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">- Nhấn tay, lồng vắt c&oacute; chống văng nước vắt kh&ocirc; cực nhanh, sạch nhờ lực quay ly t&acirc;m.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">- C&acirc;y lau s&agrave;n sạch tr&ecirc;n nhiều vật liệu: gạch men, s&agrave;n gỗ, s&agrave;n xi măng b&oacute;ng, s&agrave;n l&aacute;t đ&aacute;</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">- Quai x&aacute;ch cho th&ugrave;ng chổi lau nh&agrave; gi&uacute;p bạn dễ d&agrave;ng x&aacute;ch v&agrave; di chuyển mọi nơi</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">- Chổi lau nh&agrave; si&ecirc;u sạch nhờ B&ocirc;ng lau sợi Microfiber ti&ecirc;n tiến gi&uacute;p lấy hết r&aacute;c, t&oacute;c v&agrave; giảm tĩnh điện cho mặt s&agrave;n</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">&nbsp;- Lồng nhựa &ndash; C&oacute; trụ giặt &ndash; Xoay tay</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">- Th&ugrave;ng chứa nước cấu tạo bằng vật liệu nhựa cao cấp, si&ecirc;u nhẹ, si&ecirc;u bền, dễ d&agrave;ng di chuyển đến nhiều vị tr&iacute; kh&aacute;c nhau.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"font-size:10.5000pt\">- Ph&ugrave; hợp sử dụng cho gia đ&igrave;nh, nh&agrave; h&agrave;ng, kh&aacute;ch sạn,...</span></span></span></p>', 'Qvk3npSdb2.mp4', 123, NULL, 'https://thongminhmart.com/storage/photos/1/image_1.jpg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'cay-lau-nha-thong-minh-tu-vat-xoay-360-do', NULL, 4, NULL, NULL, NULL, 1, '2022-07-06 12:07:39', '2022-07-28 11:10:11', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:9:{s:10:\"tieu_chi_1\";a:2:{s:4:\"name\";s:10:\"Màu sắc\";s:11:\"description\";s:14:\"Xanh - trắng\";}s:10:\"tieu_chi_2\";a:2:{s:4:\"name\";s:14:\"Kích thước\";s:11:\"description\";s:21:\"Dài 1m x Rộng 35cm\";}s:10:\"tieu_chi_3\";a:2:{s:4:\"name\";s:16:\"Trọng lượng\";s:11:\"description\";s:3:\"2kg\";}s:10:\"tieu_chi_4\";a:2:{s:4:\"name\";s:11:\"Xuất xứ\";s:11:\"description\";s:12:\"Trung Quốc\";}s:10:\"tieu_chi_5\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_6\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_7\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_8\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_9\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}}', 'a:9:{s:11:\"meta_size_1\";a:4:{s:4:\"name\";s:5:\"4x5x6\";s:6:\"status\";s:6:\"active\";s:10:\"price_base\";s:6:\"110000\";s:11:\"price_final\";s:6:\"100000\";}s:11:\"meta_size_2\";a:4:{s:4:\"name\";s:5:\"5x6x7\";s:6:\"status\";s:6:\"active\";s:10:\"price_base\";s:6:\"120000\";s:11:\"price_final\";s:6:\"110000\";}s:11:\"meta_size_3\";a:4:{s:4:\"name\";s:5:\"6x7x8\";s:6:\"status\";s:6:\"active\";s:10:\"price_base\";s:6:\"130000\";s:11:\"price_final\";s:6:\"120000\";}s:11:\"meta_size_4\";a:4:{s:4:\"name\";N;s:6:\"status\";s:8:\"inactive\";s:10:\"price_base\";N;s:11:\"price_final\";N;}s:11:\"meta_size_5\";a:4:{s