(126, 'Bộ bàn ghế dã ngoại xếp gọn', '1550000', '1300000', '<p><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Bộ b&agrave;n ghế xếp gọn, nhẹ, tiện lợi khi đi du lịch, d&atilde; ngoại.</span></span></p>', NULL, '<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">&nbsp;&nbsp;&nbsp; Hewolf thương hiệu nổi tiếng thế giới về đồ d&atilde; ngoại, du lịch gi&uacute;p con người c&oacute; thể trải nhiệm niềm vui khi gần gũi với thi&ecirc;n nhi&ecirc;n. Hewolf chuy&ecirc;n sản xuất c&aacute;c d&ograve;ng sản phẩm như lều ngo&agrave;i trời, t&uacute;i ngủ ngo&agrave;i trời, đệm bơm hơi, t&uacute;i giải tr&iacute; leo n&uacute;i ngo&agrave;i trời, t&uacute;i leo n&uacute;i, balo d&atilde; ngoại v&agrave; nhiều sản phẩm ngo&agrave;i trời kh&aacute;c với chất lượng tốt, độ bền cao, mẫu m&atilde; đẹp. Thương hiệu Hewolf được ph&acirc;n phối tại hơn 40 quốc gia tr&ecirc;n thế giới v&agrave; được h&agrave;ng triệu người tin d&ugrave;ng.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">&nbsp;&nbsp;&nbsp; Sản phẩm được thiết kế nhỏ gọn nhưng chắc chắn ph&ugrave; hợp với nhu cầu mang theo khi cắm trại, du lịch. Chất liệu vải 600D bền đẹp, hợp kim nh&ocirc;m chắc chắn n&ecirc;n sử dụng rất tiện lợi v&agrave; an to&agrave;n. Bộ sản phẩm sau khi sử dụng c&oacute; thể cất gọn trong t&uacute;i đựng k&iacute;ch thước chỉ 60x30x30cm rất dễ d&agrave;ng di chuyển v&agrave; bảo quản.</span></span></span></p>', 'h7mdFnOA0a.mp4', NULL, NULL, 'https://thongminhmart.com/storage/photos/1/112276dbbed99d3c68a064468b75ecaa.jpeg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'bo-ban-ghe-da-ngoai-xep-gon', NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-28 11:06:11', '2022-07-28 11:09:47', NULL, NULL,