(127, 'Bếp nướng than hoa gấp gọn', '105000', '85000', '<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Bếp nướng than hoa kh&ocirc;ng kh&oacute;i T&acirc;n Phong</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Hộp được thiết kế tối ưu, gọn g&agrave;ng, chắc chắn tạo cảm gi&aacute;c dễ chịu khi đặt tr&ecirc;n b&agrave;n ăn v&agrave; tiện lợi khi sử dụng ngo&agrave;i trời như: đi d&atilde; ngoại, đi picnic, du lịch, c&aacute;c hoạt động ngo&agrave;i trời, sinh nhật, sum họp gia đ&igrave;nh v&agrave; bạn b&egrave;&hellip;</span></span></span></p>', NULL, '<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">Bếp than, Bếp nướng T&acirc;n Phong , Du lịch, d&atilde; ngoại, tiện lợi, dễ sử dụng</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">C&ocirc;ng cụ kh&ocirc;ng thể thiếu trong c&aacute;c bữa tiệc nướng</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">- Sử dụng than hoa, cồn kh&ocirc; chuy&ecirc;n dụng để nh&oacute;m than</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size: 16px; font-family: Arial, Helvetica, sans-serif;\">- Thiết kế kiểu hộp, gấp gọn, dễ d&agrave;ng mang theo</span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">- Kết cấu chắc chắn, chịu nhiệt tốt</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">- Chất liệu th&eacute;p kh&ocirc;ng gỉ v&agrave; inox cao cấp, bền v&agrave; dễ vệ sinh</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">- Bếp nướng than hoa kh&ocirc;ng kh&oacute;i c&oacute; hộp&nbsp;được sử dụng an to&agrave;n v&agrave; rất kinh tế, tiết kiệm than.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\"><span style=\"line-height:115%\">- Vỉ nướng được l&agrave;m từ inox chất lượng cao tạo độ bền của bếp v&agrave; đảm bảo vệ sinh của đồ nướng. To&agrave;n bộ vật liệu của bếp đều đạt ti&ecirc;u chuẩn Ch&acirc;u &Acirc;u.</span></span></span></p>', 'OCsf9ESKMG.mp4', NULL, NULL, 'https://thongminhmart.com/storage/photos/1/0046d0292ac587cd6b662b7ef0aac90a.jpeg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'bep-nuong-than-hoa-gap-gon', NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-28 11:15:10', '2022-07-28 11:15:19', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:9:{s:10:\"tieu_chi_1\";a:2:{s:4:\"name\";s:14:\"Kích thước\";s:11:\"description\";s:33:\"Dài 35cm x Rộng 27cm x Cao 7cm\";}s:10:\"tieu_chi_2\";a:2:{s:4:\"name\";s:10:\"Màu sắc\";s:11:\"description\";s:4:\"Đen\";}s:10:\"tieu_chi_3\";a:2:{s:4:\"name\";s:12:\"Vật liệu\";s:11:\"description\";s:23:\"Inox, thép không gỉ\";}s:10:\"tieu_chi_4\";a:2:{s:4:\"name\";s:15:\"Khối lượng\";s:11:\"description\";s:5:\"1.3kg\";}s:10:\"tieu_chi_5\";a:2:{s:4:\"name\";s:11:\"Xuất xứ\";s:11:\"description\";s:10:\"Việt Nam\";}s:10:\"tieu_chi_6\";a:2:{s:4:\"name