(128, 'Bộ xếp hình thiết kế thời trang', '205000', '185000', '<p><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Bộ xếp h&igrave;nh thiết kế&nbsp;thời trang d&agrave;nh cho b&eacute; g&aacute;i</span></span></p>', NULL, '<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- Sản phẩm gồm 1 hộp gỗ, 1 bảng xếp 2 mặt với thật nhiều c&aacute;c mảnh gh&eacute;p nam ch&acirc;m theo chủ đề cho b&eacute; cơ hội l&agrave;m quen với thế giới xung quanh</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- C&aacute;c mảnh gh&eacute;p của bảng gh&eacute;p h&igrave;nh nam ch&acirc;m được thiết kế sinh động, đ&aacute;ng y&ecirc;u v&agrave; m&agrave;u sắc rực rỡ nhằm gi&uacute;p trẻ h&agrave;o hứng kh&aacute;m ph&aacute; v&agrave; tiếp thu kiến thức một c&aacute;ch tự nhi&ecirc;n</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- Đi k&egrave;m với bộ đồ chơi gỗ bảng gh&eacute;p h&igrave;nh nam ch&acirc;m l&agrave; b&uacute;t vẽ cho b&eacute; c&oacute; cơ hội thể hiện sinh động v&agrave; đa dạng hơn sự s&aacute;ng tạo của m&igrave;nh.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- Đồ chơi gh&eacute;p h&igrave;nh tr&iacute; tuệ trẻ em đa chức năng gi&uacute;p ph&aacute;t triển tr&iacute; n&atilde;o trẻ nhỏ, gi&uacute;p trẻ s&aacute;ng tạo trong c&aacute;ch b&agrave;y biện. Thiết kế kh&ocirc;ng gian theo tr&iacute; tưởng tượng của b&eacute;. Với bảng đồ chơi gh&eacute;p h&igrave;nh n&agrave;y, b&eacute; vận dụng tr&iacute; tưởng tượng của m&igrave;nh để lựa chọn v&agrave; sắp xếp c&aacute;c chi tiết sao cho ch&iacute;nh x&aacute;c với h&igrave;nh mẫu. Chất liệu 100% gỗ tự nhi&ecirc;n, m&agrave;u sơn đẹp an to&agrave;n cho b&eacute;..</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- B&eacute; học c&aacute;ch quan s&aacute;t tỉ mỉ sự vật xung quanh để &aacute;p dụng v&agrave;o tr&ograve; chơi, đồng thời s&aacute;ng tạo ra những h&igrave;nh ảnh đ&aacute;ng y&ecirc;u, sống động từ tr&iacute; tưởng tượng của m&igrave;nh, gi&uacute;p l&agrave;m gi&agrave;u th&ecirc;m vốn tr&iacute; tưởng tượng, thể hiện c&aacute; t&iacute;nh ri&ecirc;ng th&ocirc;ng qua tr&ograve; chơi.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- Tr&ograve; chơi c&ograve;n k&iacute;ch th&iacute;ch v&agrave; ph&aacute;t huy tiềm năng hội họa của b&eacute;, gi&uacute;p bố mẹ dễ d&agrave;ng định hướng ph&aacute;t triển con theo đ&uacute;ng năng lực v&agrave; sở th&iacute;ch của m&igrave;nh</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:10.5pt\"><span style=\"line-height:115%\">- Bảng nam ch&acirc;m gh&eacute;p h&igrave;nh với thiết kế vừa vặn gi&uacute;p trẻ tăng cường vận động tay hiệu quả, cho b&eacute; th&ecirc;m kh&eacute;o l&eacute;o.</span></span></span></p>', 'PIkB5CmAEo.mp4', NULL, NULL, 'https://thongminhmart.com/storage/photos/1/dabdb827ca7fec87c79e0ee1463a7dde.jpeg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'bo-xep-hinh-thiet-ke-thoi-trang', NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-28 11:19:37', '2022-07-28 11:19:37', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:9:{s:10:\"tieu_chi_1\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_2\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_3\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_4\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_5\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_6\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_7\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_8\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_9\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}}', NULL, NULL),
(129, 'Bộ lắp ghép khủng long bằng gỗ (theo phương pháp STEM)', '85000', '60000', NULL, NULL, '<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Bộ lắp gh&eacute;p khủng long bằng gỗ theo phương ph&aacute;p gi&aacute;o dục STEM</span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">- Một bộ gồm c&aacute;c linh kiện bằng gỗ, d&acirc;y điện, b&oacute;ng đ&egrave;n, quạt, m&ocirc; tơ, băng keo, s&aacute;ch hướng dẫn ....</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">- Tất cả sản phẩm l&agrave;m bằng nguy&ecirc;n liệu an to&agrave;n.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">- Đi k&egrave;m c&oacute; đủ băng keo, c&aacute;c khớp nối chuẩn chỉnh, d&acirc;y điện tuốt sẵn, c&aacute;c b&eacute; chỉ việc lắp gh&eacute;p</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">- Tr&ograve; chơi r&egrave;n luyện t&iacute;nh tỉ mỉ, khả năng quan s&aacute;t, logic rất tốt cho c&aacute;c b&eacute;</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">- Bộ sản phẩm kh&ocirc;ng bao gồm pin</span></span></span></p>', 'g4sszOw0bW.mp4', 1202, NULL, 'https://thongminhmart.com/storage/photos/1/d008186f1e497012295e3f3ea8994f61.jpeg', NULL, 'active', 