(130, 'Bộ lắp ráp Robot Đội trưởng Sao Hoả', '190000', '150000', NULL, NULL, '<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">Đồ chơi gi&aacute;o dục STEM - Lắp r&aacute;p Robot Đội trưởng th&aacute;m hiểm Sao Hỏa chạy bằng Năng lượng mặt trời l&agrave; bộ đồ chơi cho ph&eacute;p trẻ em vừa học vừa chơi, l&agrave; một h&igrave;nh thức kh&aacute;m ph&aacute; thế giới tự nhi&ecirc;n, dễ chịu v&agrave; dễ tiếp thu nhất đối với trẻ, đồng thời sự s&aacute;ng tạo được đ&aacute;nh thức trong trẻ sẽ đơm hoa kết tr&aacute;i trong tương lai.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">- Sản phẩm gồm 2 vỉ chứa c&aacute;c chi tiết, bố mẹ h&atilde;y sử dụng cuốn sổ hướng dẫn để c&ugrave;ng b&eacute; tạo ra những m&ocirc; h&igrave;nh th&uacute; vị, k&iacute;ch th&iacute;ch th&oacute;i quen t&igrave;m t&ograve;i, s&aacute;ng tạo của b&eacute;.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">Những ưu điểm của sản phẩm:</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">- Sản xuất mới nhất năm 2021.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">- Sử dụng pin năng lượng mặt trời, tiết kiệm chi ph&iacute; thay pin, sử dụng năng lượng sạch sẵn c&oacute; th&acirc;n thiện m&ocirc;i trường</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">- Hoạt động tốt nhất dưới &aacute;nh nắng mặt trời, ngo&agrave;i ra bố mẹ c&oacute; thể sử dụng dưới b&oacute;ng đ&egrave;n halogen 50W v&agrave;o những ng&agrave;y mưa.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">- Tem CR VIETNAMCONTROL chứng nhận sản ph&acirc;̉m ph&ugrave; hợp Ti&ecirc;u chu&acirc;̉n kỹ thuật v&agrave; Chứng nhận sản ph&acirc;̉m ph&ugrave; hợp Quy chu&acirc;̉n kỹ thuật qu&ocirc;́c gia</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:13px\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">Sản phẩm sử dụng cho trẻ từ 10 tuổi trở l&ecirc;n</span></span></span></p>', 'cwDtw4dqnG.mp4', NULL, NULL, 'https://thongminhmart.com/storage/photos/1/b2757dae204d664ce0490adfcaf3114a.jpeg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'bo-lap-rap-robot-doi-truong-sao-hoa', NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-28 11:26:05', '2022-07-28 11:29:39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:9:{s:10:\"tieu_chi_1\";a:2:{s:4:\"name\";s:20:\"Kích thước hộp\";s:11:\"description\";s:33:\"Dài 35cm x Rộng 28cm x Cao 6cm\";}s:10:\"tieu_chi_2\";a:2:{s:4:\"name\";s:10:\"Màu sắc\";s:11:\"description\";s:14:\"Ghi xám - Cam\";}s:10:\"tieu_chi_3\";a:2:{s:4:\"name\";s:13:\"Chất liệu\";s:11:\"description\";s:16:\"Nhựa cao cấp\";}s:10:\"tieu_chi_4\";a:2:{s:4:\"name\";s:15:\"Khối lượng\";s:11:\"description\";s:8:\"300 gram\";}s:10:\"tieu_chi_5\";a:2:{s:4:\"name\";s:11:\"Xuất xứ\";s:11:\"description\";s:10:\"Việt Nam\";}s:10:\"tieu_chi_6\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_7\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_8