(131, 'Lều cắm trại tự bung dành cho 4 người', '799000', '599000', NULL, NULL, '<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">✅ Th&ocirc;ng tin sản phẩm:</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Lều cắm trại chống nước tự bung d&agrave;nh cho 4-5 người cỡ chuẩn:</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Loại : 2 cửa tho&aacute;ng m&aacute;t</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- M&agrave;u sắc : Xanh dương, Xanh thẫm, Cam, Xanh Cam</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- K&iacute;ch Thước: &nbsp;200 x 200 x 135cm</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Trọng lượng: 2 - 3.5kg</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Chất liệu : Vải chống nước 200T, vải nylon oxford 210D với chức năng kh&ocirc;ng thấm nước cho t&uacute;i ngo&agrave;i trời</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Khung nhựa &nbsp;dẻo</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Cửa sổ lưới k&eacute;o b&ecirc;n trong</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Th&aacute;o lắp dễ d&agrave;ng, nhanh ch&oacute;ng</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Khả năng kh&aacute;ng nước v&agrave; chịu lực tốt.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Th&iacute;ch hợp cho 4 - 5 người sử dụng</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- D&ugrave;ng cho đi cắm trại b&atilde;i biển, đi leo n&uacute;i, ngo&agrave;i c&ocirc;ng vi&ecirc;n, ph&ograve;ng ngủ, s&acirc;n thượng.</span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">✅ Ưu điểm vươt trội:</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- K&iacute;ch thước lều lớn, kh&ocirc;ng gian rộng r&atilde;i thoải m&aacute;i cho 4 - 5 người sử dụng.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Kết cấu khung chắc chắn, vải chống thấm hiệu quả.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Thiết kế hiện đại, trẻ trung, ph&ugrave; hợp với mọi lứa tuổi v&agrave; sở th&iacute;ch</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Dễ d&agrave;ng lắp đặt sử dụng, dễ d&agrave;ng gấp gọn bảo quản, vận chuyển.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Gi&aacute; th&agrave;nh hợp l&iacute;, ph&ugrave; hợp với từng nhu cầu sử dụng của kh&aacute;ch h&agrave;ng.</span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">✅ Chế độ bảo h&agrave;nh:</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Shop cam kết sản phẩm ch&iacute;nh h&atilde;ng, 1 đổi 1 nếu xảy ra lỗi từ nh&agrave; sản xuất.</span></span></p>', 'hmLth3XVm0.mp4', NULL, NULL, 'https://thongminhmart.com/storage/photos/1/63d5d7bf1096741e2ea2f8edb6226fd1.jpeg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'leu-cam-trai-tu-bung-danh-cho-4-nguoi', NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-29 08:44:28', '2022-07-29 08:44:28', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:9:{s:10:\"tieu_chi_1\";a:2:{s:4:\"name\";s:10:\"Màu sắc\";s:11:\"description\";s:12:\"Xanh dương\";}s:10:\"tieu_chi_2\";a:2:{s:4:\"name\";s:14:\"Kích thước\";s:11:\"description\";s:24:\"D220cm x R185cm x C130cm\";}s:10:\"tieu_chi_3\";a:2:{s:4:\"name\";s:13:\"Chất liệu\";s:11:\"description\";s:28:\"Vải chống thấm nước\";}s:10:\"tieu_chi_4\";a:2:{s:4:\"name\";s:16:\"Trọng lượng\";s:11:\"description\";s:5:\"2.2kg\";}s:10:\"tieu_chi_5\";a:2:{s:4:\"name\";s:11:\"Xuất xứ\";s:11:\"description\";s:12:\"Trung Quốc\";}s:10:\"tieu_chi_6\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_7\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_8\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_9\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}}', NULL, NULL),
(132, 'Nhà lắp ghép thông minh cho bé dùng bìa carton', '169000', '149000', '<p><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Nh&agrave; lắp gh&eacute;p th&ocirc;ng m&igrave;nh l&agrave;m từ b&igrave;a carton</span></span></p>', NULL, '<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">Mơ ước c&oacute; 1 ng&ocirc;i nh&agrave; ri&ecirc;ng hay chơi dựng nh&agrave; l&agrave; sở th&iacute;ch của hầu hết c&aacute;c b&eacute; trong độ tuổi từ 2 tuổi trở l&ecirc;n. Với sản phẩm NH&Agrave; LẮP GH&Eacute;P TH&Ocirc;NG MINH CHO B&Eacute; bằng th&ugrave;ng Carton c&aacute;c b&eacute; sẽ được thỏa m&atilde;n t&iacute;nh s&aacute;ng tạo, ph&aacute;t huy khả năng phản xạ, th&iacute;ch nghi v&agrave; cảm nhận thế giới xung quanh thật tuyệt vời. Thiết kế m&ocirc; phỏng như một ng&ocirc;i nh&agrave; thật, c&oacute; cửa ra v&agrave;o, cửa sổ v&agrave; m&aacute;i nh&agrave;, nh&agrave; carton sẽ gi&uacute;p b&eacute; c&oacute; một kh&ocirc;ng gian ri&ecirc;ng đầy c&aacute; t&iacute;nh.&nbsp;</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">TH&Ocirc;NG TIN SẢN PHẨM<br />\r\n- K&iacute;ch thước nh&agrave; carton: 100*90*90 cm&nbsp;<br />\r\n- K&iacute;ch thước đ&oacute;ng g&oacute;i: 100*47*6 cm<br />\r\n- Chất liệu: 100% giấy carton th&acirc;n thiện m&ocirc;i trường.<br />\r\n- Chất liệu carton 5-7 lớp si&ecirc;u bền, c&oacute; thể chịu lực l&ecirc;n tới 17 kg.<br />\r\n- Sản xuất tại: Việt Nam.<br />\r\n- Ph&ugrave; hợp cho b&eacute; trai v&agrave; b&eacute; g&aacute;i.<br />\r\n- Độ tuổi: Từ 2-10 tuổi.</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">Bạn c&oacute; thể mua k&egrave;m đ&egrave;n v&agrave; m&agrave;u shop c&oacute; b&aacute;n để trang tr&iacute; cho ng&ocirc;i nh&agrave; th&ecirc;m lung lunh hơn nh&eacute; !!</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">-------------------------------<br />\r\nAN TO&Agrave;N, SI&Ecirc;U BỀN CHO B&Eacute; THỎA SỨC VUI CHƠI</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">Bộ sản phẩm Nh&agrave; Giấy Caron gồm nhiều mảnh carton đ&atilde; được cắt sẵn, gấp kh&uacute;c sẵn. Nhận h&agrave;ng phụ huynh hay b&eacute; chỉ việc lắp gh&eacute;p c&aacute;c mảnh lại th&agrave;nh ng&ocirc;i nh&agrave; ho&agrave;n chỉnh cho b&eacute;.</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Đảm bảo sử dụng khớp gh&eacute;p KH&Ocirc;NG sử dụng keo, ghim; KH&Ocirc;NG chất độc hại. KH&Ocirc;NG c&oacute; cạnh sắc v&igrave; to&agrave;n bộ đ&atilde; được b&agrave;o sần</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">- B&eacute; tự trang tr&iacute; theo &yacute; th&iacute;ch của m&igrave;nh từ c&aacute;c mảnh gh&eacute;p của ng&ocirc;i nh&agrave;, t&ocirc; m&agrave;u, d&aacute;n giấy, decal, sticker từ những h&igrave;nh th&ugrave; ngộ nghĩnh,...</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Tạo kh&ocirc;ng gian ri&ecirc;ng cho c&aacute;c b&eacute; tự lập hơn, tự do s&aacute;ng tạo, ba mẹ ho&agrave;n to&agrave;n y&ecirc;n t&acirc;m &nbsp;để con vui chơi trong một g&oacute;c nhỏ.</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">- B&eacute; vừa c&oacute; chỗ chơi, vừa tạo sự ngăn nắp, gọn g&agrave;ng dạy b&eacute; biết sắp xếp đồ đạc v&agrave;o đ&uacute;ng chỗ khi chơi xong.</span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">-----------------<br />\r\nLưu &yacute;: Nh&agrave; nguy&ecirc;n bản như h&igrave;nh thứ 2<br />\r\nC&aacute;c h&igrave;nh c&oacute; m&agrave;u v&agrave; đ&egrave;n l&agrave; kh&aacute;ch mua về v&agrave; c&oacute; trang tr&iacute; th&ecirc;m</span></p>', '8PoifTFJJb.mp4', NULL, NULL, 'https://thongminhmart.com/storage/photos/1/03b6ec46d30bf065914d622cf0507f59.jpeg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'nha-lap-ghep-thong-minh-cho-be-dung-bia-carton', NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-29 