(133, 'Trạm sạc dự phòng 48.000mAh kiêm kích nổ ắc quy ô tô Yoobao Q150C', '2399000', '1999000', NULL, NULL, '<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">M&Ocirc; TẢ SẢN PHẨM</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Trạm sạc dự ph&ograve;ng 48000mAh Yoobao 150C - K&iacute;ch nổ ắc quy &ocirc; t&ocirc; - Sạc nhanh PD3.0 - H&agrave;ng ch&iacute;nh h&atilde;ng - Bảo h&agrave;nh 12 th&aacute;ng 1 đổi 1</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">THỜI GIAN GIAO H&Agrave;NG SI&Ecirc;U TỐC ĐỘ:</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Đơn giao hỏa tốc: Thời gian từ 1-3 giờ sau khi x&aacute;c nhận đơn.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Đơn giao b&igrave;nh thường: Thời gian từ 1-3 ng&agrave;y sau khi x&aacute;c nhận đơn.</span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Trạm sạc dự ph&ograve;ng Yoobao c&oacute; dung lượng 48000mAh, hỗ trợ hầu hết c&aacute;c chuẩn sạc nhanh hiện nay, tương th&iacute;ch với hầu hết c&aacute;c thiết bị số hiện nay từ Macbook/ Laptop cho đến Smartphone/ Tablet,... Dung lượng lớn, c&ocirc;ng suất, hiệu suất sử dụng cao (l&ecirc;n đến 30W) hỗ trợ sạc nhanh QC3.0 v&agrave; PD3.0, c&oacute; thể d&ugrave;ng để k&iacute;ch b&igrave;nh &ocirc; t&ocirc;. Gi&uacute;p cho mọi thiết bị của bạn lu&ocirc;n trong t&igrave;nh trạng sẵn s&agrave;ng sử dụng.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">**Ch&uacute; &yacute;: Sản phẩm Trạm sạc v&agrave; Quạt &nbsp;được b&aacute;n ra đều được d&aacute;n tem. Yoobao sẽ từ chối bảo h&agrave;nh nếu sản phẩm kh&ocirc;ng c&oacute; tem hoặc tem kh&ocirc;ng c&ograve;n nguy&ecirc;n vẹn. Nếu nhận h&agrave;ng m&agrave; kiểm tra kh&ocirc;ng thấy c&oacute; tem th&igrave; li&ecirc;n hệ bộ phận CSKH để được giải quyết).</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">T&Iacute;NH NĂNG:</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Pin Lithium sắt phốt ph&aacute;t, dung lượng 48000mAh/3.2V (153Wh).</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- C&ocirc;ng nghệ sạc nhanh PD3.0 với tổng c&ocirc;ng suất 30W đầu v&agrave;o v&agrave; 30W đầu ra.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Thời gian sử dụng: Sạc đầy iPhone XS khoảng 11.7 lần, Macbook 12 khoảng 2 lần, Flycam khoảng 2.5 lần, M&aacute;y ảnh DSLR kho&agrave;ng 8.3 lần, d&ugrave;ng cho tủ lạnh khoảng 4 lần, m&aacute;y chiếu khoảng 8.3h</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Cổng v&agrave;o Type-C.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- 3 Cổng ra USB-A, 1 cổng ra Type-C, 1 cổng Socket 12V v&agrave; 1 cổng ra EC5 12V-200A.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- C&oacute; thể d&ugrave;ng cho điện thoại, m&aacute;y t&iacute;nh bảng, m&aacute;y t&iacute;nh x&aacute;ch tay, tủ lạnh, quạt, m&aacute;y chiếu, flycam c&ugrave;ng c&aacute;c thiết bị điện kh&aacute;c.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- C&oacute; thể k&iacute;ch b&igrave;nh ắc quy để khởi động xe hơi khi cần.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- T&iacute;ch hợp đ&egrave;n LED chiếu s&aacute;ng v&agrave; tay x&aacute;ch bằng da v&ocirc; c&ugrave;ng tiện lợi.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- M&agrave;n h&igrave;nh LED hiển thị ch&iacute;nh x&aacute;c từng 1% pin c&ograve;n lại.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- C&oacute; nhiều c&aacute;ch để sạc lại như pịn như: Adapter, sạc xe hơi, năng lượng mặt trời.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Hỗ trợ d&acirc;y sạc đi k&egrave;m sản phẩm.</span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">CH&Iacute;NH S&Aacute;CH BẢO H&Agrave;NH </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Bảo h&agrave;nh chất lượng sản phẩm 12 th&aacute;ng.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Với phương ch&acirc;m quyền lợi của kh&aacute;ch h&agrave;ng l&agrave; quan trọng nhất, Yoobao Việt Nam x&acirc;y dựng ch&iacute;nh s&aacute;ch đổi trả d&agrave;nh cho kh&aacute;ch h&agrave;ng như sau: </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Trong v&ograve;ng 15 ng&agrave;y đầu sau khi mua h&agrave;ng. </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- 1 đổi 1 trong 1 năm theo ch&iacute;nh s&aacute;ch bảo h&agrave;nh. </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">- Tất cả c&aacute;c sản phẩm tu&acirc;n theo điều khoản bảo h&agrave;nh tại thời điểm xuất h&oacute;a đơn cho kh&aacute;ch h&agrave;ng.</span></span></p>', '68tPUJ36jj.mp4', NULL, NULL, 'https://thongminhmart.com/storage/photos/1/300c6a330c7bbb6c78e1c208caa42bbd.jpeg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'tram-sac-du-phong-48000mah-kiem-kich-no-ac-quy-o-to-yoobao-q150c', NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-29 09:17:26', '2022-07-29 09:17:26', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:9:{s:10:\"tieu_chi_1\";a:2:{s:4:\"name\";s:14:\"Kích thước\";s:11:\"description\";s:24:\"D149mm x R142mm x C113mm\";}s:10:\"tieu_chi_2\";a:2:{s:4:\"name\";s:10:\"Màu sắc\";s:11:\"description\";s:14:\"Đen - Trắng\";}s:10:\"tieu_chi_3\";a:2:{s:4:\"name\";s:16:\"Trọng lượng\";s:11:\"description\";s:7:\"1.62 kg\";}s:10:\"tieu_chi_4\";a:2:{s:4:\"name\";s:10:\"Loại pin\";s:11:\"description\";s:26:\"Lithium sắt phốt-phát\";}s:10:\"tieu_chi_5\";a:2:{s:4:\"name\";s:13:\"Dung lượng\";s:11:\"description\";s:9:\"48.000mAh\";}s:10:\"tieu_chi_6\";a:2:{s:4:\"name\";s:16:\"Công suất pin\";s:11:\"description\";s:11:\"153Wh (TYP)\";}s:10:\"tieu_chi_7\";a:2:{s:4:\"name\";s:29:\"Tổng công suất đầu ra\";s:11:\"description\";s:3:\"30W\";}s:10:\"tieu_chi_8\";a:2:{s:4:\"name\";s:9:\"Cổng ra\";s:11:\"description\";s:36:\"02 USB-A, 01 USB-C, 01 DC12V, 01 EC5\";}s:10:\"tieu_chi_9\";a:2:{s:4:\"name\";s:22:\"Công suất đèn LED\";s:11:\"description\";s:5:\"5Watt\";}}', NULL, NULL),
(134, 'Tuốc-nơ-vít đa năng', '125000', '89000', NULL, NULL, '<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">T&ocirc; V&iacute;t Xoay Đầu K&egrave;m Mũi V&iacute;t l&agrave; sản phẩm kết hợp</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Đầu t&ocirc; v&iacute;t c&oacute; thể xoay theo nhiều hướng kh&aacute;c nhau</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Th&acirc;n t&ocirc; v&iacute;t bằng nhựa tổng hợp bền v&agrave; chắc chắn </span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">B&ecirc;n trong th&acirc;n chu&ocirc;i c&oacute; chứa c&aacute;c đầu mũi v&iacute;t ch&acirc;n lục gi&aacute;c 1/4&quot; (cộng, trừ, hoa thị, 2 cạnh)</span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">==&gt; Hướng dẫn sử dụng:</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">T&ocirc; V&iacute;t Xoay Đầu K&egrave;m Mũi V&iacute;t Nhật Bản được sử dụng bằng phương ph&aacute;p đơn giản, bạn chỉ cần đẩy nhẹ chu&ocirc;i t&ocirc; v&iacute;t (phần m&agrave;u đỏ) ra để lấy đầu mũi v&iacute;t</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Lắp đầu mũi v&iacute;t l&ecirc;n đầu xoay</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Bấm chốt lẫy tr&ecirc;n c&aacute;n để điều chỉnh hướng l&agrave;m việc ph&ugrave; hợp</span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">***Hướng dẫn bảo quản:</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Cất gọn c&aacute;c mũi v&iacute;t v&agrave;o chu&ocirc;i</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">C&oacute; thể thoa 1 lớp dầu nhẹ để &nbsp;bảo quản tốt hơn c&aacute;c đầu mũi v&iacute;t</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Quy c&aacute;ch đ&oacute;ng g&oacute;i:</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">T&ocirc; V&iacute;t Xoay Đầu K&egrave;m Mũi V&iacute;t Nhật Bản được đ&oacute;ng g&oacute;i 1 tay t&ocirc; v&iacute;t trong 1 vỉ </span></span></p>', '3zyZNtJOpP.mp4', NULL, NULL, 'https://thongminhmart.com/storage/photos/1/a8b281d1ea361f61edf692a9b709ee0d.jpeg', NULL, 'active', NULL, NULL, 0, NULL, 0, 'tuoc-no-vit-da-nang', NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-29 09:21:55', '2022-07-29 09:21:55', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:9:{s:10:\"tieu_chi_1\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_2\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_3\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_4\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_5\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_6\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_7\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_8\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}s:10:\"tieu_chi_9\";a:2:{s:4:\"name\";N;s:11:\"description\";N;}}', NULL, NULL);
