(26, 'Footer - Mô tả chung', '<p style=\"text-align: center;\">AnyClass l&agrave; nền tảng cung cấp những kho&aacute; học online với đa dạng c&aacute;c chủ đề kh&aacute;c nhau. Sứ mệnh của Anyclass kh&ocirc;ng chỉ đơn thuần cung cấp kiến thức m&agrave; c&ograve;n khai mở những đam m&ecirc;, những khả năng tiềm ẩn của bạn. Học với Anyclass, bạn kh&ocirc;ng những được cung cấp học cụ, học liệu, b&agrave;i tập để thực h&agrave;nh ngay m&agrave; c&ograve;n được kết nối với giảng vi&ecirc;n, học vi&ecirc;n kh&aacute;c để tạo th&agrave;nh một cộng đồng c&ugrave;ng chung một sở th&iacute;ch. AnyClass tin tưởng sẽ đem đến cho học vi&ecirc;n những trải nghiệm th&uacute; vị v&agrave; gi&uacute;p bạn ph&aacute;t triển hơn nữa năng lực của m&igrave;nh, biến giấc mơ th&agrave;nh hiện thực.</p>', NULL, 'inactive', 'footer_description', NULL, NULL, NULL, 28, '2021-06-09 23:27:55', '2021-07-18 23:13:57', NULL, NULL),
(27, 'Footer - Copyright', '<p class=\"footer-copy-right\">&copy; Bản quyền thuộc về <strong>C&Ocirc;NG TY TNHH ANYHOW</strong>&nbsp;</p>', NULL, 'inactive', 'footer_block_bottom', NULL, NULL, NULL, 1, '2021-06-09 23:28:41', '2022-01-06 03:00:49', 1, NULL),
(28, 'Khối 1', '<p><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\">Mở rộng&nbsp;đầu tư mạnh mẽ trong nhiều lĩnh vực c&ugrave;ng&nbsp;c&aacute;c đối t&aacute;c trong v&agrave; ngo&agrave;i nước với t&ecirc;n gọi C&ocirc;ng ty TM&amp;ĐT Dako, tập trung v&agrave;o 3 lĩnh vực kinh doanh cốt l&otilde;i:</span></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\">- C&ocirc;ng&nbsp;Nghiệp</span></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\">- Tư Vấn &amp; X&uacute;c Tiến Đầu Tư FDI</span></span></p>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"font-size:16px;\">- Thương Mại</span></span></p>', '2021', 'inactive', 'timeline', NULL, '<p><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:120%\"><span lang=\"VI\"><span style=\"line-height:120%\">Dako Investment and Trading Co., Ltd </span></span><span lang=\"KO\"><span style=\"line-height:120%\">회사라는</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">이름으로</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">국내외</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">파트너사와</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">함께</span></span><span lang=\"VI\"><span style=\"line-height:120%\">3</span></span><span lang=\"KO\"><span style=\"line-height:120%\">가지의</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">핵심</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">사업</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">분야에</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">중점을</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">두면서</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">관련</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">다양한</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">분야에서</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">투자를</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">크게</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">확대하였습니다</span></span><span lang=\"VI\"><span style=\"line-height:120%\">:</span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:120%\"><span lang=\"VI\"><span style=\"line-height:120%\">&nbsp; &nbsp; - </span></span><span lang=\"KO\"><span style=\"line-height:120%\">산업</span></span> </span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:120%\"><span lang=\"VI\"><span style=\"line-height:120%\">&nbsp; &nbsp; - FDI</span></span><span lang=\"KO\"><span style=\"line-height:120%\">투자</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">추진</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">및</span></span> <span lang=\"KO\"><span style=\"line-height:120%\">컨설팅</span></span> </span></span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:120%\"><span lang=\"VI\"><span style=\"line-height:120%\">&nbsp; &nbsp; - </span></span><span lang=\"KO\"><span style=\"line-height:120%\">무역</span></span></span></span></span></p>', 8, 1, '2021-11-19 14:56:56', '2021-12-05 18:44:00', 1, NULL),
